	@RequestMapping(method = RequestMethod.GET)
	public ModelAndView doGet(HttpServletRequest request,
			HttpServletResponse response) {
		int type = Integer.parseInt(request.getParameter("type"));
		// String url =
		// "http://www.zgwj.gov.cn/upfile/template/contentpage/zgwj_zwgknew/xxgkdt.aspx?Itemtype=6&WebID=145&nodeID=3954";
		Document doc;
		String cnt = "";
		String content = "";
		try {
			doc = Jsoup.connect(urls[type]).get();
			Elements tdList = doc.select("table[bordercolor=\"D3D3C7\"]");
			cnt = tdList.get(1).toString();
			content = cnt.replaceAll("nry.aspx",
					"http://www.zgwj.gov.cn/upfile/template/contentpage/zgwj_zwgknew/nry.aspx");			
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		Map<String, Object> map = new HashMap<String, Object>();
		map.put("content", content);
		map.put("type", type);
		return new ModelAndView("government", map);
	}

	@RequestMapping(method = RequestMethod.POST)
	public ModelAndView doPost(HttpServletRequest request,
			HttpServletResponse response) throws IOException {
		int type = Integer.parseInt(request.getParameter("type"));
		String pageNum = request.getParameter("pageNum");		
		Document doc;
		String cnt = "";
		//System.out.println(type);
		//System.out.println(pageNum);
		PrintWriter out = response.getWriter();
		try {
			doc = Jsoup
					.connect(urls[type])
					.data("__EVENTTARGET", "AspNetPager1", "__EVENTARGUMENT",
							pageNum, "__VIEWSTATE", VIEWSTATE[type],
							"__EVENTVALIDATION", EVENTVALIDATION[type]).post();
			Elements tdList = doc.select("table[bordercolor=\"D3D3C7\"]");
			cnt = tdList.get(1).toString();
			String content = cnt.replaceAll("nry.aspx",
					"http://www.zgwj.gov.cn/upfile/template/contentpage/zgwj_zwgknew/nry.aspx");
			//System.out.println(content);
			out.print(content);
		} catch (IOException e) {			
			e.printStackTrace();
			out.print("error");
		}
		return null;
	}
